Bonjour je m'appelle oceane je suis âgée de 25 ans et suis maman d'un petit garçon de 2 ans 
J'ai obtenu le diplôme d'assistante de vie aux familles , et ayant acquis le module " petite enfance " je suis formée a travailler aupres des enfants de tout age :) 
Et etant maman c'est un gros avantage également , j'ai travaillé en micro-crèche etant en stage aux alentours de bailleul , j'adore cuisiner patisser , creer des activités et serait ravie de vous aider pour m'occuper de vos petits ou grands bouts de choux :);
